import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  AppBar,
  Button,
  FormRow,
  Grid,
  Toolbar,
  Typography
  } from '@material-ui/core';
  import { withStyles } from '@material-ui/core/styles';

import ThreatMap from './ThreatMap';

const StyledButton = withStyles({
  root: {
    color: "white"
  }
})(Button);

function App(){
  return(
    <BrowserRouter>
      <AppBar color="primary" position="sticky">
        <Toolbar>
          <StyledButton component={Link} to="/">Demo App</StyledButton>
        </Toolbar>
      </AppBar>
      <div>
      <Grid container spacing={1}>
  <Grid container item xs={12} spacing={3}>
    <FormRow />
  </Grid>
  <Grid container item xs={12} spacing={3}>
    <FormRow />
  </Grid>
  <Grid container item xs={12} spacing={3}>
    <FormRow />
  </Grid>
</Grid>
        <Button color="primary" component={Link} to="/network-threat-map">
          Network incidents near you
        </Button>
        <Switch>
          <Route path='/network-threat-map'>
            <ThreatMap />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
